@java.lang.SuppressWarnings("unchecked")
public class MockitoCore {
    private final org.mockito.exceptions.Reporter reporter = new org.mockito.exceptions.Reporter();

    private final org.mockito.internal.util.MockUtil mockUtil = new org.mockito.internal.util.MockUtil();

    private final org.mockito.internal.progress.MockingProgress mockingProgress = new org.mockito.internal.progress.ThreadSafeMockingProgress();

    public <T> T mock(java.lang.Class<T> classToMock, org.mockito.MockSettings mockSettings, boolean shouldResetOngoingStubbing) {
        return mock(classToMock, mockSettings);
    }

    public <T> T mock(java.lang.Class<T> classToMock, org.mockito.MockSettings mockSettings) {
        mockingProgress.validateState();
        mockingProgress.resetOngoingStubbing();
        return mockUtil.createMock(classToMock, ((org.mockito.internal.creation.MockSettingsImpl) (mockSettings)));
    }

    public org.mockito.internal.progress.IOngoingStubbing stub() {
        org.mockito.internal.progress.IOngoingStubbing stubbing = mockingProgress.pullOngoingStubbing();
        if (stubbing == null) {
            mockingProgress.reset();
            reporter.missingMethodInvocation();
        }
        return stubbing;
    }

    @java.lang.Deprecated
    public <T> org.mockito.internal.DeprecatedOngoingStubbing<T> stub(T methodCall) {
        mockingProgress.stubbingStarted();
        return ((org.mockito.internal.DeprecatedOngoingStubbing) (stub()));
    }

    public <T> org.mockito.internal.OngoingStubbing<T> when(T methodCall) {
        mockingProgress.stubbingStarted();
        return ((org.mockito.internal.OngoingStubbing) (stub()));
    }

    public <T> T verify(T mock, org.mockito.internal.verification.api.VerificationMode mode) {
        if (mock == null) {
            reporter.nullPassedToVerify();
        } else if (!mockUtil.isMock(mock)) {
            reporter.notAMockPassedToVerify();
        }
        mockingProgress.verificationStarted(mode);
        return mock;
    }

    public <T> void reset(T... mocks) {
        mockingProgress.validateState();
        mockingProgress.reset();
        mockingProgress.resetOngoingStubbing();
        for (T m : mocks) {
            mockUtil.resetMock(m);
        }
    }

    public void verifyNoMoreInteractions(java.lang.Object... mocks) {
        assertMocksNotEmpty(mocks);
        mockingProgress.validateState();
        for (java.lang.Object mock : mocks) {
            try {
                if (mock == null) {
                    reporter.nullPassedToVerifyNoMoreInteractions();
                }
                mockUtil.getMockHandler(mock).verifyNoMoreInteractions();
            } catch (org.mockito.exceptions.misusing.NotAMockException e) {
                reporter.notAMockPassedToVerifyNoMoreInteractions();
            }
        }
    }

    private void assertMocksNotEmpty(java.lang.Object[] mocks) {
        if ((mocks == null) || (mocks.length == 0)) {
            reporter.mocksHaveToBePassedToVerifyNoMoreInteractions();
        }
    }

    public org.mockito.InOrder inOrder(java.lang.Object... mocks) {
        if ((mocks == null) || (mocks.length == 0)) {
            reporter.mocksHaveToBePassedWhenCreatingInOrder();
        }
        for (java.lang.Object mock : mocks) {
            if (mock == null) {
                reporter.nullPassedWhenCreatingInOrder();
            } else if (!mockUtil.isMock(mock)) {
                reporter.notAMockPassedWhenCreatingInOrder();
            }
        }
        return new org.mockito.internal.InOrderImpl(java.util.Arrays.asList(mocks));
    }

    public org.mockito.internal.Stubber doAnswer(org.mockito.internal.Answer answer) {
        mockingProgress.stubbingStarted();
        mockingProgress.resetOngoingStubbing();
        return new org.mockito.internal.stubbing.StubberImpl().doAnswer(answer);
    }

    public <T> org.mockito.internal.VoidMethodStubbable<T> stubVoid(T mock) {
        org.mockito.internal.MockHandlerInterface<T> handler = mockUtil.getMockHandler(mock);
        mockingProgress.stubbingStarted();
        return handler.voidMethodStubbable(mock);
    }

    public void validateMockitoUsage() {
        mockingProgress.validateState();
    }

    public org.mockito.internal.invocation.Invocation getLastInvocation() {
        org.mockito.internal.stubbing.OngoingStubbingImpl ongoingStubbing = ((org.mockito.internal.stubbing.OngoingStubbingImpl) (mockingProgress.pullOngoingStubbing()));
        java.util.List<org.mockito.internal.invocation.Invocation> allInvocations = ongoingStubbing.getRegisteredInvocations();
        return allInvocations.get(allInvocations.size() - 1);
    }
}

